import React, { Component } from 'react';
import logo from '../../images/logo.jpg';
import { Link } from "react-router-dom";
//import PropTypes from 'prop-types';

class Header extends Component {
   constructor() {
      super();
    }

    render() {
      return (
        <div className="App-page App-header">
          <div className="App-logo" component={ Link } to="/"><img src={logo} alt="logo" /></div>
          <div className="App-header-menu">
			      <div component={ Link } to="/home">home</div>
            <div component={ Link } to="/about">About</div>
            <div component={ Link } to="/blog">blog</div>
          </div>
        </div>
          )
    }
  }

export default Header;
